{"id":"session:1754022512072:gsqjgyt86","userId":"user:1754021119012:lsln0dr8j","highlightedItems":[{"id":"1754022723698","text":"하지만, 요즘은 점점 제가 하는 일에 대한 이유를 찾기가 어려워지고 있어요. 제가 만들어 내는 바람이 모든 동물에게 행복을 주지 못한다면, 제가 하는 일은 의미가 없는 건가요?","color":"#03ff00","paragraphIndex":5,"problemReason":"전체적으로 직업의 의미, 직업이 사회에 공헌하는 점, 그것이 실현되기 어려운 상황에 대한 고민인 것 같았다. 그걸 잘 요약한 부분이 여기라고 생각했다.","userExplanation":"약간 결이 다르긴 하다. 그리고 저렇게 명확하게 보이기보단 은연중에 하는 고민이었던 것 같다. 인공지능에 대한 공부를 하고 관련 직종에서 일하는 것을 목표로 잡고 있지만, 정작 내가 해야 하는 업무의 상당수를 인공지능이 대체하는 것을 보며 내가 나 스스로 일자리를 부수려고 이 짓을 하는 건가 하는 회의감이 들 때가 있었다. 

